								  IN strName VARCHAR(20),
								  IN blobPhoto LONGBLOB,
								  IN strDesc VARCHAR(60))
BEGIN
	
    DECLARE intCateCode INT;
    
    SELECT
		intProdCateCode
	INTO 
		intCateCode
	FROM 
		tblProductCategory
	WHERE
		strProdCategory = strCate;
        
	IF(intCateCode IS NULL)
    THEN
		
